d(123)\n","split = sample.split(ds$Customer_Segment, SplitRatio = 0.8)\n","train_set = subset(ds, split == TRUE)\n","test_set = subset(ds, split == FALSE)\n","\n","#Feature Scaling\n","\n","train_set[-14] = scale(train_set[-14])\n","test_set[-14] = scale(test_set[-14])\n","\n","#Implementing the LDA Model\n","library(MASS)\n","lda = lda(formula = Customer_Segment ~ ., data = train_set)\n","train_set = as.data.frame(predict(lda, train_set))\n","test_set = as.data.frame(predict(lda, test_set))\n","print(head(train_set))\n","print(head(test_set))\n","train_set = train_set[c(5, 6, 1)]\n","test_set = test_set[c(5, 6, 1)]\n","print(head(train_set))\n","print(head(test_set))"]},{"cell_type":"markdown","id":"b075b13e","metadata":{"papermill":{"duration":0.177262,"end_time":"2022-03-24T19:36:50.706079","exception":false,"start_time":"2022-03-24T19:36:50.528817","status":"completed"},"tags":[]},"source":["#### **Building & Training the Support Vector Classification model on the Linear Discriminant Train set**"]},{"cell_type":"code","execution_count":17,"id":"903431e0","metadata":{"execution":{"iopub.execute_input":"2022-03-24T19:36:51.065389Z","iopub.status.busy":"2022-03-24T19:36:51.063785Z","iopub.status.idle":"2022-03-24T19:36:51.127259Z","shell.execute_reply":"2022-03-24T19:36:51.12579Z"},"papermill":{"duration":0.243853,"end_time":"2022-03-24T19:36:51.127415","exception":false,"start_time":"2022-03-24T19:36:50.883562","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["   y_pred\n","     1  2  3\n","  1 12  0  0\n","  2  1 13  0\n","  3  0  0 10\n","Accuracy of LDA Support Vector Classification Model is: 0.9722222"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 3</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>precision</th><th scope=col>recall</th><th scope=col>f1</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>1</th><td>0.9230769</td><td>1.0000000</td><td>0.960000</td></tr>\n","\t<tr><th scope=row>2</th><td>1.0000000</td><td>0.9285714</td><td>0.962963</td></tr>\n","\t<tr><th scope=row>3</th><td>1.0000000</td><td>1.0000000</td><td>1.000000</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 3 × 3\n","\\begin{tabular}{r|lll}\n","  & precision & recall & f1\\\\\n","  & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t1 & 0.9230769 & 1.0000000 & 0.960000\\\\\n","\t2 & 1.0000000 & 0.9285714 & 0.962963\\\\\n","\t3 & 1.0000000 & 1.0000000 & 1.000000\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 3 × 3\n","\n","| <!--/--> | precision &lt;dbl&gt; | recall &lt;dbl&gt; | f1 &lt;dbl&gt; |\n","|---|---|---|---|\n","| 1 | 0.9230769 | 1.0000000 | 0.960000 |\n","| 2 | 1.0000000 | 0.9285714 | 0.962963 |\n","| 3 | 1.0000000 | 1.0000000 | 1.000000 |\n","\n"],"text/plain":["  precision recall    f1      \n","1 0.9230769 1.0000000 0.960000\n","2 1.0000000 0.9285714 0.962963\n","3 1.0000000 1.0000000 1.000000"]},"metadata":{},"output_type":"display_data"}],"source":["# Fitting SVM to the Training set\n","# install.packages('e1071')\n","library(e1071)\n","classifier = svm(formula = class ~ .,\n","                 data = train_set,\n","                 type = 'C-classification',\n","                 kernel = 'linear')\n","\n","# Predicting the Test set results\n","y_pred = predict(classifier, newdata = test_set[-3])\n","\n","#KEY PERFORMANCE INDICATORS (KPI)\n","#Generating the Confusion Matrix and Evaluation Metrics\n","# Making the Confusion Matrix\n","cm = table(test_set[, 3], y_pred)\n","print(cm)\n","# Evaluation Metrics\n","n = sum(cm) # number of instances\n","nc = nrow(cm) # number of classes\n","diag = diag(cm) # number of correctly classified instances per class \n","rowsums = apply(cm, 1, sum) # number of instances per class\n","colsums = apply(cm, 2, sum) # number of predictions per class\n","p = rowsums / n # distribution of instances over the actual classes\n","q = colsums / n # distribution of instances over the predicted classes\n","accuracy = sum(diag) / n \n","cat(\"Accuracy of LDA Support Vector Classification Model is:\", accuracy)  \n","precision = diag / colsums \n","recall = diag / rowsums \n","f1 = 2 * precision * recall / (precision + recall) \n","data.frame(precision, recall, f1)"]},{"cell_type":"markdown","id":"80a24703","metadata":{"papermill":{"duration":0.202182,"end_time":"2022-03-24T19:36:51.509122","exception":false,"start_time":"2022-03-24T19:36:51.30694","status":"completed"},"tags":[]},"source":["#### **Visualizing the Linear Discriminant Train sets**"]},{"cell_type":"code","execution_count":18,"id":"c5008f92","metadata":{"execution":{"iopub.execute_input":"2022-03-24T19:36:51.872845Z","iopub.status.busy":"2022-03-24T19:36:51.871381Z","iopub.status.idle":"2022-03-24T19:36:51.99797Z","shell.execute_reply":"2022-03-24T19:36:51.997321Z"},"papermill":{"duration":0.31156,"end_time":"2022-03-24T19:36:51.998126","exception":false,"start_time":"2022-03-24T19:36:51.686566","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1xT9xoG8DeLhA2yQZClgjhRFLcgVEVw48C9ap1V3HXPWrVurbu4cOPGgYqT\noThw4QYVAWXLCoQk94/0crmgVjTkwOH5/tHP7XuSkye/a+Xh5OQcjlwuJwAAAACo/LhMBwAA\nAAAA5UCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAA\nAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAA\nlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJ\nFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCx\nAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsA\nAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAAAGAJFDsAAAAAlkCxAwAA\nAGAJFDsAAAAAlkCxAwAAAGAJFLvKRyqVXrhwQSqVMh2kSsBqqxgWXJWw2qqE1ValqrzaKHaV\nz9mzZzt06HD27Fmmg1QJWG0Vw4KrElZblbDaqlSVVxvFrvLJy8sr+ieUN6y2imHBVQmrrUpY\nbVWqyquNYgcAAADA